int checkShot(cursor *check) {
	
	for (int i = 0; i < NUM_BOXES; i++) {
		int deltaX = abs((*check).xPos - TARGETS[i].xPos);
		int deltaY = abs(check->yPos - TARGETS[i].yPos);
		if (deltaY < SHOT_RANGE && deltaX < SHOT_RANGE) {
			score++;
			check->shot = 1;
			TARGETS[i].shot = 1;
			return 1;
		} 
	}
	//strike++;
	return 0;
}

