void draw_line(int x1, int y1, int x2, int y2, short int color, int erase) {
	int is_steep;// = abs(y2 - y1) > abs(x2 - x1)? 1: 0;
	if (abs(y2 - y1) > abs(x2 - x1)) {
		is_steep = 1;
	} else {
		is_steep = 0;
	}
	if (is_steep) {
		swap(&x1, &y1);
		swap(&x2, &y2);
	}
	if (x1 > x2) {
		swap(&x1, &x2);
		swap(&y1, &y2);
		
	}
	int deltax = x2 - x1;
	int deltay = abs(y2 - y1);
	int error = -(deltax / 2);
	int y = y1;
	int y_step;// = y1 < y2 ? 1 : -1;
	if (y1 < y2) {
		y_step = 1;
	} else {
		y_step = -1;
	}
	
	for (int i = x1; i < x2; i++) {
		if (is_steep) {
			if(!erase){
				plot_pixel(y, i, color);
			}
			else {
				plot_pixel(y, i, bg[i][y]);
			}
		} else {
			if(!erase)
			{
				plot_pixel(i, y, color);
			} else {
				plot_pixel(i, y, bg[y][i]);
			}
		}
		error = error + deltay;
		if (error >= 0) {
			y += y_step;
			error = error - deltax;
		}
	}
}

void clear_screen(int color) {
	for (int x = 0; x < 320; x++) {
		for (int y = 0; y < 240; y++) {
			*(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = color;
		}
	}
}



